app.get("/saveMsg", (req,res,next)=>{    
    let mycol = g_conn.db('foodash').collection('customer');
    let msg = JSON.parse(req.header("message"));    //{sender, receiver, time, message}
    msg.isNotDelivered = false;

    //debug
    //console.log(`msg: ${JSON.stringify(msg, null, 2)}`);    // chat:{"mega":[{}, ...], "Yoshi":[{},...]}

    mycol.updateOne(
        {"personinfo.name":msg.sender},
        [{$set: {
            ["chat."+msg.receiver]:{
                $ifNull: [                              
                    { $concatArrays: ["$chat."+msg.receiver, [msg]]},
                    [msg]
                ]
            }
        }}]
    );
    mycol.updateOne(
        {"personinfo.name":msg.receiver},
        [{$set: {
            ["chat."+msg.sender]:{
                $ifNull: [
                    { $concatArrays: ["$chat."+msg.sender, [msg]]},
                    [msg]
                ]
            }
        }}]
    );
    res.send("SUCCESS");
});
